import React from "react";
import AccountCircleIcon from '@material-ui/icons/AccountCircle';

const SingleDropDown = ({item1, item2, href1, href2}) =>{

    return (
        <div>
            <div class="dropdown">
                <AccountCircleIcon class="buttons dropdown-toggle" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
                    Menu
                </AccountCircleIcon>
                <ul class="dropdown-menu" aria-labelledby="dropdownMenuButton1">
                    <li><a class="dropdown-item" href={href1}>{item1}</a></li>
                    <li><a class="dropdown-item" href={href2}>{item2}</a></li>
                    <li><a href="#"></a></li>
                </ul>
            </div>
        </div>
    );
}

export default SingleDropDown;
